    </Svg>
  );
};
export const listMode= ({color,size, viewBox}) => {
  return (
    <Svg
    fill={color}
      width={size}
      height={size}
      viewBox={viewBox}
    >
      <path d="M4 18h17v-6H4v6zM4 5v6h17V5H4z" />
    </Svg>
  );
};
export const gridMode= ({color,size, viewBox}) => {
  return (
    <Svg
